import React from 'react';
import ReactDOM from 'react-dom';

const flname = "bansi khagram";
const lname = "anil bhai";

ReactDOM.render( 
    <> 
    <h1> My Name Is {flname} {lname} </h1>
    <p> my lucky num is {Math.random()} </p>
    </>, 
    document.getElementById("root"));
